"use strict";const e=React.createElement;class LikeButton extends React.Component{constructor(e){super(e),this.state={liked:!1}}render(){return this.state.liked?"You liked comment number: "+this.props.commentId:e("button",{onClick:()=>this.setState({liked:!0})},"Like")}}const domContainer=document.querySelectorAll(".like_btn").forEach((t=>{const n=parseInt(t.dataset.id,10);ReactDOM.render(e(LikeButton,{commentId:n}),t)}));